import React from 'react'

const Footer = () => {
  return (
    <footer>

      <> 
        <p>Powered by</p>
        <img src="./images/DH.png" alt='DH-logo' />
        <a href="https://www.facebook.com/"><img src="./images/ico-facebook.png" alt="facebook-logo" /></a>
        </>
    </footer>
  )
}

export default Footer
